module AssessmentToolHelper
  require 'redis_interact'

# Returns a set of assessment divisions that has questions.
  def assessment_divisions(assessment)
    if assessment.quiz_sections.empty?
      [assessment]
    else
      assessment_division_set = []
      assessment.quiz_sections.each do |quiz_section|
        if quiz_section.children_sections.empty? and quiz_section.parent_id.nil?
          assessment_division_set << quiz_section
        else
          quiz_section.children_sections.each do |child_section|
            assessment_division_set << child_section
          end
        end
      end
      assessment_division_set
    end

  end

  def total_sections(assessment)
    assessment_divisions(assessment).count
  end

# Returns a presentable name for a given assessment division
  def name(assessment_division)
    if assessment_division.nil?
      return
    end
    if assessment_division.is_a?(Quiz)
      return assessment_division.name
    end
    if assessment_division.parent_id?
      parent_name = QuizSection.find(assessment_division.parent_id).name
      "#{parent_name} / #{assessment_division.name}"
    else
      assessment_division.name
    end
  end


# Returns the corresponding quiz_id
  def get_quiz_id(assessment_division)
    if assessment_division.is_a?(Quiz)
      return assessment_division.id
    else
      return assessment_division.quiz_id
    end

  end

  def get_assessment_div_type(assessment_division)
    if assessment_division.is_a?(Quiz)
      "simple_quiz"
    else
      "quiz_section"
    end
  end

  def show_qtype(qtype)
    qtypes = {'desc'=>'Descriptive','fib'=> 'Fill in the blanks', 'multichoice'=>'Multichoice', 'truefalse'=>'True or False','passage'=>'Passage','laq'=>'Large Answer Question','saq'=>'Small Answer Question','vsaq'=>'Very Short Answer Question'}
    qtypes[qtype]
  end

  def get_tag_values(tag_name,publisher_question_bank_id=nil)
    if publisher_question_bank_id
      if ["specialCategory","blooms_taxonomy"].include? tag_name
        tags = PublisherQuestionBank.find(publisher_question_bank_id).tags.where(:name=>tag_name)
        tags.map(&:value).join(",")
      elsif ['academic_class', 'subject', "difficulty_level"].include? tag_name
        Tag.where("tags_db_id=? AND name=? AND standard=?",1,tag_name, true).map(&:value).join(",")
      else
        Tag.includes(:tag_references)
        .where("tag_references.publisher_question_bank_id=? AND tags.name=?",publisher_question_bank_id,tag_name)
        .map(&:value).join(",")
      end
    else
      Tag.includes(:tag_references)
      .where("tags.name=?",tag_name)
      .map(&:value).join(",")
    end
  end

  def select_default(quiz,field_name)
    ((quiz.nil? or quiz.new_record?) || quiz.quiz_detail[field_name].nil?) ? {} : quiz.quiz_detail[field_name]
  end

  def select_default_ncx(quiz,field_name)
    ((quiz.nil? or quiz.new_record?) || quiz.context.nil? || quiz.context[field_name] == 0 ) ? {} : quiz.context[field_name]
  end

  def quiz_tag_filters(user,quiz,tag_name,publisher_question_bank)
    if quiz.nil? or quiz.new_record?
      return Tag.includes(:tag_references).where("tags.name='#{tag_name}' and tag_references.publisher_question_bank_id=#{publisher_question_bank.id}")
    end
    if tag_name == "subject"
      quiz_tag_ids = [quiz.quiz_detail.academic_class_tag_id]
    else
      quiz_tag_ids = [quiz.quiz_detail.academic_class_tag_id] + [quiz.quiz_detail.subject_tag_id]
    end
    quiz_tag_ids  = quiz_tag_ids - [nil]
    #tag_references = TagReference.where(:institution_id => user.institution_id,:tag_id=>quiz_tag_ids).group(:tag_refer_id).having('COUNT(*) = ?', quiz_tag_ids.count)
    tag_references = TagReference.where(:publisher_question_bank_id => publisher_question_bank.id,:tag_id=>quiz_tag_ids).group(:tag_refer_id).having('COUNT(*) = ?', quiz_tag_ids.count)
    Tag.where(:id=>tag_references.map(&:tag_refer_id),:name=>tag_name)
  end


  def get_user_type_group(board,group_type,quiz)
    #board = user.institution.boards.first
    if (quiz.nil? or quiz.new_record?) or board.id == 25009
      Content.where(:board_id=>board.id,:type=>group_type)
    else
      #subject = quiz.context.subject_id
      content_year = quiz.context.nil? ? "" : quiz.context.content_year_id
      if group_type == "ContentYear"
        Content.where(:board_id=>board.id,:type=>group_type)
      else
        Content.where(:board_id=>board.id,:type=>group_type,:content_year_id=>content_year)
      end
    end
  end

